import ProfileSearch from './ProfileSearch/ProfileSearch';
import ProfileCard from './ProfileCard/ProfileCard';

function Profile() {
  return (
    <div style={{display:'flex' }}>
      <ProfileSearch/>
      <ProfileCard/>
    </div>
  );
}

export default Profile;
